import React from "react";
import SignIn from "./components/SignIn";
import SignUp from "./components/SignUp";

import { BrowserRouter, Router, Routes } from "react-router-dom";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route index element={<SignUp />}></Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;

